import { IonButtons, IonContent, IonHeader, IonMenuButton, IonPage, IonTitle, IonToolbar, IonButton, IonSplitPane, IonRouterOutlet } from '@ionic/react';
import React from 'react';
import './Home.css';
import tools from '../components/Tools';
import Widgets from '../components/Widgets';
import Menu from '../components/Menu';
const Home: React.FC = () => {
  return (
    <IonPage>
      <Widgets.routes/>
      <Widgets.Header/>
      <IonSplitPane contentId="menu">
        <Menu/>
        <IonRouterOutlet id="menu">
          <IonHeader>
            <IonToolbar>
              <IonButtons slot="start">
                <IonMenuButton />
              </IonButtons>
              <IonTitle>{tools.MSG.APPNAME}</IonTitle>
            </IonToolbar>
          </IonHeader>

          <IonContent fullscreen>
            <IonButton onClick={()=>{
              tools.clickById("login")
            }}>login</IonButton>
            <IonButton onClick={()=>{
              tools.clickById("recover")
            }}>recover</IonButton>
            <IonButton onClick={()=>{
              tools.clickById("register")
            }}>register</IonButton>
          </IonContent>
        </IonRouterOutlet>
      </IonSplitPane>
    </IonPage>
  );
};

export default Home;
